import React, { Component } from "react";
import Search from "./components/Search";
import List from "./components/List";

export default class App extends Component {
  //初始化用户数组
  state = { users: [] };

  saveUsers = (users) => {
    //将获取到的数据保存
    this.setState({ users });
  };
  render() {
    return (
      <div className="container">
        <Search />
        <List />
      </div>
    );
  }
}
